#!/usr/bin/env bash
set -euo pipefail
CLI=${CLI:-~/bchn/build/src/bitcoin-cli\ -datadir=/bitcoin-bchn-tempnet}
# Example: CLI="~/bchn/build/src/bitcoin-cli -datadir=/bitcoin-bchn-tempnet"

send_tx() {
  local file="$1"
  local hex="$2"
  echo "Sending $file..."
  if output=$(printf '%s\n' "$hex" | $CLI -stdin sendrawtransaction 2>&1); then
    echo "  TXID: $output"
    return 0
  fi
  if [[ "$output" == *"Missing inputs"* ]] || [[ "$output" == *"transaction already in block chain"* ]]; then
    echo "  Skipping ($output)"
    return 0
  fi
  echo "$output" >&2
  return 1
}

